import React from 'react';
import FormComponent3 from '../components/FormComponent3';

// Subject data array
const subjectsData = [
  {
    name: "Radiology & Imageology",
    theoryMax: 150,
    theoryMin: 75,
    theorySecured: '',
    practicalMax: 50,
    practicalMin: 25,
    practicalSecured: '',
    totalMax: 200,
    totalMin: 100,
    result: 'Fail'
  },
  {
    name: "Geriatric Medicine & Rehab",
    theoryMax: 150,
    theoryMin: 75,
    theorySecured: '',
    practicalMax: 50,
    practicalMin: 25,
    practicalSecured: '',
    totalMax: 200,
    totalMin: 100,
    result: 'Fail'
  },
  {
    name: "P.T in Cardio-thoratic Surgery",
    theoryMax: 100,
    theoryMin: 50,
    theorySecured: '',
    practicalMax: 50,
    practicalMin: 25,
    practicalSecured: '',
    totalMax: 150,
    totalMin: 75,
    result: 'Pass'
  },
  {
    name: "Rehabilation Medicine",
    theoryMax: 100,
    theoryMin: 50,
    theorySecured: '',
    practicalMax: 50,
    practicalMin: 25,
    practicalSecured: '',
    totalMax: 150,
    totalMin: 75,
    result: 'Pass'
  }
];

// Functional component to render the form
const BPT8Semester = () => {
  return (
    <FormComponent3
      title="7 Semester Final Examination (BPT)"
      subjectsData={subjectsData}
    />
  );
};

export default BPT8Semester ;
